  handleChange = (type) => {
    if(type != this.content) {
      this.content = type
      if (this.content === "Home"){
        return <div>aa</div>
      }
      else if (this.content === "Home"){
        return <div>{this.content}</div>
      }
    }

  };

  render() {
    const {contentType} = this.props;
    const ctx = this.handleChange(contentType)
    return (
      <div>
        {ctx}
      </div>
    );
  }
}
export default Content;
